DROP TABLE IF EXISTS `tcor_trn_transaction`;
CREATE TABLE `tcor_trn_transaction` (
  `ACC_TRAN_NO` varchar(40) NOT NULL COMMENT '记账流水号_AC+YYYYMMDD+10位SEQUENCES',
  `SYS_CODE` varchar(8) NOT NULL COMMENT '来源系统编号_交易来源系统编号',
  `MACHINE_NO` varchar(40) DEFAULT NULL COMMENT '来源机器编号_交易来源机器编号(机器IP)',
  `CHANNEL_NO` varchar(4) NOT NULL COMMENT '来源渠道_交易来源渠道编号',
  `TERMINAL_NO` varchar(10) DEFAULT NULL COMMENT '终端号_主要指pos交易终端号',
  `TRAN_CODE` varchar(8) NOT NULL COMMENT '记账交易码_记账交易码',
  `IPS_BILL_NO` varchar(40) DEFAULT NULL COMMENT 'IPS订单号',
  `APP_TRAN_NO` varchar(40) DEFAULT NULL COMMENT '应用交易流水号_应用流水号【应用交易唯一标识符】',
  `APP_BATCH_NO` varchar(40) DEFAULT NULL COMMENT '应用批次流水号_处理交易的批次号,如下发',
  `CUS_TRAN_NO` varchar(40) DEFAULT NULL COMMENT '商户流水号',
  `CHL_TRAN_NO` varchar(40) DEFAULT NULL COMMENT '支付流水号_支付核心流水号（适用于收单，退款业务）',
  `PRD_CODE` varchar(40) DEFAULT NULL COMMENT '基础产品编号',
  `TRAN_TYPE` varchar(8) NOT NULL COMMENT '交易类型',
  `INITIATOR_FLG` char(1) DEFAULT NULL COMMENT '发起方标识_0:收款方 1：付款方 2：其他',
  `PAYEE_CODE` varchar(40) DEFAULT NULL COMMENT '收款方编号_商户号或个人账户号',
  `PAYEE_ACC_CODE` varchar(40) DEFAULT NULL COMMENT '收款方交易账户号',
  `PAYEE_TYPE` char(1) DEFAULT NULL COMMENT '收款方类型_0：个人 1：商户 2:银行或IPS',
  `PAYEE_REL_SUB_CODE` varchar(40) DEFAULT NULL COMMENT '收款方科目',
  `PAYER_CODE` varchar(40) DEFAULT NULL COMMENT '付款方编号_商户号或个人账户号',
  `PAYER_ACC_CODE` varchar(40) DEFAULT NULL COMMENT '付款方交易账户号',
  `PAYER_TYPE` char(1) DEFAULT NULL COMMENT '付款方类型_0：个人 1：商户 2:银行或IPS',
  `PAYER_REL_SUB_CODE` varchar(40) DEFAULT NULL COMMENT '付款对方科目',
  `SUPPLIER_CODE` varchar(40) DEFAULT NULL COMMENT '供应商编号_供应商编号',
  `CHANNEL_CODE` varchar(40) DEFAULT NULL COMMENT '支付通道_通道',
  `CCY_CODE` varchar(3) NOT NULL COMMENT '币种_156人民币',
  `TRAN_AMT` decimal(24,4) NOT NULL COMMENT '交易金额_FEE_AMT = 0 则 TRAN_AMT = ORD_AMT',
  `ORD_AMT` decimal(24,4) DEFAULT NULL COMMENT '订单金额_TRAN_AMT = ORD_AMT + FEE_AMT',
  `IS_FEE` char(1) DEFAULT NULL COMMENT '手续费是否已计算_0:未计算 1：已计算',
  `FEE_AMT` decimal(24,4) DEFAULT NULL COMMENT '手续费_通常情况下的各项手续费总计 如 100元入账 1元手续费扣除',
  `FEE_TYPE` char(1) DEFAULT NULL COMMENT '手续费计算方式_1：定额 2：百分比',
  `FEE_RATE` decimal(10,4) DEFAULT NULL COMMENT '手续费费率_手续费费率',
  `FEE_FLAG` char(1) DEFAULT NULL COMMENT '手续费收取方式_1:付款方 2：收款方 3：第三方',
  `FEE_STL_MODE` char(1) DEFAULT NULL COMMENT '手续费结算方式_1:日结 2：预付费 3：后结算',
  `THIRD_ACC_CODE` varchar(40) DEFAULT NULL COMMENT '第三方手续费账号',
  `REFUND_FEE_BK` char(1) DEFAULT NULL COMMENT '退款是否退手续费_预留，待以后使用',
  `BANK_ACC_CODE` varchar(40) DEFAULT NULL COMMENT '通道对应银行收款账号_通道对应银行收款账号',
  `BANK_COST` decimal(24,4) DEFAULT NULL COMMENT '银行成本_通道成本',
  `BANK_FEE_TYPE` char(2) DEFAULT NULL COMMENT '通道费率计算方式_00：百分比 :10：固定 01：百分比附加成本 11：按固定附加成本',
  `BANK_FEE_RATE` decimal(10,4) DEFAULT NULL COMMENT '通道费率',
  `APP_TRAN_DATE` date DEFAULT NULL COMMENT '应用交易时间_yyyy-MM-dd HH24:MI:SS',
  `SUBMIT_TIME` date NOT NULL COMMENT '交易落地时间_yyyy-MM-dd HH24:MI:SS',
  `FINNISH_TIME` date DEFAULT NULL COMMENT '交易完成时间_yyyy-MM-dd HH24:MI:SS',
  `ACC_DATE` date NOT NULL COMMENT '账务日期_yyyy-MM-dd 交易账务日期，用于与外围对账',
  `IS_DEPOSIT` char(1) DEFAULT NULL COMMENT '是否保证金交易_0:非保证金交易 1：保证金交易',
  `SECURITY_DEPOSIT` decimal(24,4) DEFAULT NULL COMMENT '交易保证金金额',
  `DEPOSIT_REFUND_DATE` date DEFAULT NULL COMMENT '保证金返还日期_yyyy-MM-dd',
  `DEPOSIT_STATUS` char(1) DEFAULT NULL COMMENT '保证金缴纳状态_0:未缴纳 1：已缴纳 2：已返还',
  `RETURNED_DEPOSIT_AMT` decimal(24,4) DEFAULT NULL COMMENT '已返还保证金金额_已返还保证金金额 退款或拒付时的累计退款退还保证金金额',
  `REFUNDED_AMT` decimal(24,4) DEFAULT NULL COMMENT '已退款金额_已退款金额 退款时的累计退款金额',
  `DISHONORED_AMT` decimal(24,4) DEFAULT NULL COMMENT '已拒付金额_已拒付金额 拒付时的累计退款金额',
  `EST_ACC_TIME` date DEFAULT NULL COMMENT '预计入账时间_yyyy-MM-dd HH24:MI:SS',
  `ACC_MODE` char(1) DEFAULT NULL COMMENT '记账模式_1：同步 2：异步',
  `ACC_STATUS` char(1) NOT NULL COMMENT '记账状态_0：待处理 1：正常记账  2：差错记账  【商户不存在】',
  `FROZEN_FLAG` char(1) NOT NULL COMMENT '冻结标识_0:正常 1：冻结',
  `STATUS` char(1) NOT NULL COMMENT '处理状态_0:正常 1:退款 2:拒付 3:部分退款、拒付',
  `BLN_MODE` char(1) NOT NULL COMMENT '入账模式_0：默认 1:T+0实时入账 2：T+0延时入账 3：T+N入账 4：人工触发入账',
  `BLN_STATUS` char(1) NOT NULL COMMENT '入账状态_0：未入账 1：已入账 2：无需入账 3：可内部入账 4：不可入账 ',
  `CAN_BLN_DATE` date DEFAULT NULL COMMENT '预计入账日期_yyyy-MM-dd 账务日期',
  `BLN_DATE` date DEFAULT NULL COMMENT '实际入账日期_yyyy-MM-dd 账务日期',
  `ERR_MSG` varchar(256) DEFAULT NULL COMMENT '记账失败原因_差错记账失败原因',
  `VOUCHER_NO` varchar(256) DEFAULT NULL COMMENT '凭证号_公安凭证号',
  `ORI_APP_TRAN_NO` varchar(40) DEFAULT NULL COMMENT '原应用交易流水号_应用流水号【应用交易唯一标识符】',
  `TRAN_REMARK` varchar(256) DEFAULT NULL COMMENT '交易备注',
  `RESV1` varchar(40) DEFAULT NULL COMMENT '预留字段1',
  `RESV2` varchar(40) DEFAULT NULL COMMENT '预留字段2',
  `RESV3` varchar(40) DEFAULT NULL COMMENT '预留字段3',
  `RESV4` varchar(40) DEFAULT NULL COMMENT '预留字段4',
  `RESV5` varchar(256) DEFAULT NULL COMMENT '预留字段5',
  `CREATE_TIME` varchar(30) DEFAULT NULL COMMENT '创建时间_yyyy-MM-dd HH24:MI:SS',
  `CREATE_BY` varchar(40) DEFAULT NULL COMMENT '创建人',
  `MODIFY_TIME` varchar(30) DEFAULT NULL COMMENT '更新时间_yyyy-MM-dd HH24:MI:SS',
  `MODIFY_BY` varchar(40) DEFAULT NULL COMMENT '更新人',
  PRIMARY KEY (`ACC_TRAN_NO`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

